import React, { Component } from 'react'
import './css/App.css'

import Search from './components/Search'

class App extends Component {
    render() {
        return (
            <div>
                <div className='list_margin'></div>
                <Search />

                <div className='list_margin'></div>
            </div>
        )
    }
}

export default App
